import React from 'react';
import logo from './logo.svg';
import './App.css';

const todo = {
  text: 'Lifts head when on his tummy',
  done: false,
};

const App: React.FC<todo> = ({text, done}) => {
  return <>
<div>
  <input type='checkbox'/>
  <p>{text}</p>
  </div>
  </>
}

export default App;
